import CategoryBody from '../components/body/CategoryBody'



const Index = ({ categoryId }) => {
  const meta = {
    title: 'a',
    keywords: [
      'a'
    ],
    description: 'a'
  }

  return (
    <MainLayout>
      <CategoryBody
        category_id={1} />
    </MainLayout >
  )
}

export default withApollo({ ssr: true })(Index)
